import { SignupContext } from '../home/SignupContext';
const UserHome = () => {

    const { user} = useContext(AuthContext);
   
    return (
        <div>
            
            <Nav/>
            
            
            <h1>This is the User home</h1>
            <h1>Hello {user.username}</h1>
            
        </div>
    );
}

